import './App.css';
import { Route, Routes } from 'react-router-dom';
import Main from './pages/Main/Main';
import Signup from './pages/Signup/Signup';
import Login from './pages/Login/Login';
import Search from './pages/Search/Search';
import MyProfile from './pages/MyProfile/MyProfile';

function App() {
    const [signUpInfo, setSignUpInfo] = useState({
        id: '',
        password: '',
        repassword: '',
        gender: '',
        age: '',
    });
    return (
        <Routes>
            <Route path="/" element={<Main />} />
            <Route path="/signup/1" element={<SignupStep1 signUpInfo={signUpInfo} setSignUpInfo={setSignUpInfo} />} />
            <Route path="/signup/2" element={<SignupStep2 signUpInfo={signUpInfo} setSignUpInfo={setSignUpInfo} />} />
            <Route
                path="/signup/3"
                element={<SignupStep3 signUpInfo={signUpInfo} setSignUpInfo={setSignUpInfo} />}
            />{' '}
            <Route path="/login" element={<Login />} />
            <Route path="/search" element={<Search />} />
            <Route path="/my-profile" element={<MyProfile />} />
        </Routes>
    );
}

export default App;
